import Header from './Header';
import Video from './Video';
import Footer from './Footer';
import Logo from './Logo';

import './Kotyatki.css';

function Kotyatki() {
  return (
    <>
      <Header></Header>
      <div className="kotyatki">
        <Logo></Logo>
        <Video></Video>
      </div>
      <Footer></Footer>
    </>
  );
}

export default Kotyatki;
